import {
  repeaterData,
  RepeaterControl,
} from '../../../gutenberg-repeater-control/index.js';

const { __ } = wp.i18n;
const { registerBlockType } = wp.blocks;
const { RichText,InspectorControls } = wp.blockEditor;

const {
  PanelBody,
  PanelRow,
  ToggleControl,
  TextControl,
  TextareaControl,
  RadioControl,
} = wp.components;

const name = "gb/centeredcardwithgraphic";

registerBlockType(name, {
  title: __("Centered Card With Graphic", "GB"),
  icon: (
    <img src="data:image/png;base64," />
  ),
  category: "newsletter",
  attributes: {
    method: {
      type: "string",
      default: "GET",
    },
    action: {
      type: "string",
      default: "",
    },
    message: {
      type: "string",
      default: "",
    },
    subject: {
      type: "string",
      default: "",
    },
    to: {
      type: "string",
      default: "",
    },
    hidden: {
      type: "string|array",
      source: "attribute",
      selector: "select",
      attribute: "hidden",
      default: [],
    },
    contentUA: { type: "string", default: `` },
    contentt: {
      type: "string",
      default: `Get notified when we&rsquo;re launching.`,
    },
    contentUB: {
      type: "string",
      default: `Sagittis scelerisque nulla cursus in enim consectetur quam. Dictum urna sed consectetur neque tristique pellentesque.`,
    },
    contentUC: { type: "string", default: `Email address` },
    contentUD: { type: "string", default: `Notify me` },
  },
  edit: function (props) {
    const { attributes, setAttributes } = props;
    const { send } = attributes;

    return (
      <div className="bg-white py-16 sm:py-24">
         <InspectorControls>
          <PanelBody title="Email settings">
            <PanelRow>
              <ToggleControl
                label="Send email"
                checked={send}
                onChange={() => setAttributes({ send: !send })}
              />
            </PanelRow>
            {send ? (
              <div>
                <PanelRow>
                  <TextControl
                    label="To"
                    value={attributes.to}
                    onChange={(to) => setAttributes({to})}
                  />
                </PanelRow>
                <PanelRow>
                  <TextControl
                    label="Subject"
                    value={attributes.subject}
                    onChange={(subject) => setAttributes({subject})}
                  />
                </PanelRow>
                <PanelRow>
                  <TextareaControl
                    label="Message"
                    value={attributes.message}
                    onChange={(message) => setAttributes({message})}
                  />
                </PanelRow>
              </div>
            ) : (
              ""
            )}
          </PanelBody>
          <PanelBody title="Form settings">
            <PanelRow>
              <RadioControl
                label="Method"
                selected={attributes.method}
                options={[
                  { label: "GET", value: "GET" },
                  { label: "POST", value: "POST" },
                ]}
                onChange={(method) => setAttributes({ method })}
              />
            </PanelRow>
            <PanelRow>
              <TextControl
                label="Action"
                onChange={(action) => setAttributes({ action })}
              />
            </PanelRow>

            <PanelRow>
              <b>Hidden fields</b>
            </PanelRow>
            <PanelRow>
              <RepeaterControl
                max={5}
                value={props.attributes.hidden}
                onChange={(val) => {
                  props.setAttributes({ hidden: val });
                }}
              >
                {(value, onChange) => {
                  return [
                    <TextControl
                      label="Name"
                      value={value.name}
                      onChange={(v) => {
                        value.name = v;
                        onChange(value);
                      }}
                    />,
                    <TextControl
                      label="Value"
                      value={value.val}
                      onChange={(v) => {
                        value.val = v;
                        onChange(value);
                      }}
                    />,
                  ];
                }}
              </RepeaterControl>
            </PanelRow>
          </PanelBody>
        </InspectorControls>
        <div className="relative sm:py-16">
          
          <div aria-hidden="true" className="hidden sm:block">
            
            <div className="absolute inset-y-0 left-0 w-1/2 bg-gray-50 rounded-r-3xl">
              <RichText
                value={attributes.contentUA}
                default={""}
                onChange={(newtext) => setAttributes({ contentUA: newtext })}
              />
            </div>
            <svg
              className="absolute top-8 left-1/2 -ml-3"
              width="404"
              height="392"
              fill="none"
              viewBox="0 0 404 392"
            >
              
              <defs>
                
                <pattern
                  id="8228f071-bcee-4ec8-905a-2a059a2cc4fb"
                  x="0"
                  y="0"
                  width="20"
                  height="20"
                  patternUnits="userSpaceOnUse"
                >
                  
                  <rect
                    x="0"
                    y="0"
                    width="4"
                    height="4"
                    className="text-gray-200"
                    fill="currentColor"
                  />
                </pattern>
              </defs>
              <rect
                width="404"
                height="392"
                fill="url(#8228f071-bcee-4ec8-905a-2a059a2cc4fb)"
              />
            </svg>
          </div>
          <div className="mx-auto max-w-md px-4 sm:max-w-3xl sm:px-6 lg:max-w-7xl lg:px-8">
            
            <div className="relative rounded-2xl px-6 py-10 bg-indigo-600 overflow-hidden shadow-xl sm:px-12 sm:py-20">
              
              <div
                aria-hidden="true"
                className="absolute inset-0 -mt-72 sm:-mt-32 md:mt-0"
              >
                
                <svg
                  className="absolute inset-0 h-full w-full"
                  preserveAspectRatio="xMidYMid slice"
                  xmlns="http://www.w3.org/2000/svg"
                  fill="none"
                  viewBox="0 0 1463 360"
                >
                  
                  <path
                    className="text-indigo-500 text-opacity-40"
                    fill="currentColor"
                    d="M-82.673 72l1761.849 472.086-134.327 501.315-1761.85-472.086z"
                  />
                  <path
                    className="text-indigo-700 text-opacity-40"
                    fill="currentColor"
                    d="M-217.088 544.086L1544.761 72l134.327 501.316-1761.849 472.086z"
                  />
                </svg>
              </div>
              <div className="relative">
                
                <div className="sm:text-center">
                  
                  <h2 className="text-3xl font-extrabold text-white tracking-tight sm:text-4xl">
                    <RichText
                      value={attributes.contentt}
                      default={"Get notified when we&rsquo;re launching."}
                      onChange={(newtext) =>
                        setAttributes({ contentt: newtext })
                      }
                    />
                  </h2>
                  <p className="mt-6 mx-auto max-w-2xl text-lg text-indigo-200">
                    <RichText
                      value={attributes.contentUB}
                      default={
                        "Sagittis scelerisque nulla cursus in enim consectetur quam. Dictum urna sed consectetur neque tristique pellentesque."
                      }
                      onChange={(newtext) =>
                        setAttributes({ contentUB: newtext })
                      }
                    />
                  </p>
                </div>
                <form
                  action="#"
                  className="mt-12 sm:mx-auto sm:max-w-lg sm:flex"
                >
                  
                  <div className="min-w-0 flex-1">
                    
                    <label for="cta-email" className="sr-only">
                      <RichText
                        value={attributes.contentUC}
                        default={"Email address"}
                        onChange={(newtext) =>
                          setAttributes({ contentUC: newtext })
                        }
                      />
                    </label>
                    <input
                      id="cta-email"
                      type="email"
                      className="block w-full border border-transparent rounded-md px-5 py-3 text-base text-gray-900 placeholder-gray-500 shadow-sm focus:outline-none focus:border-transparent focus:ring-2 focus:ring-white focus:ring-offset-2 focus:ring-offset-indigo-600"
                      placeholder="Enter your email"
                    />
                  </div>
                  <div className="mt-4 sm:mt-0 sm:ml-3">
                    
                    <button
                      type="submit"
                      className="block w-full rounded-md border border-transparent px-5 py-3 bg-indigo-500 text-base font-medium text-white shadow hover:bg-indigo-400 focus:outline-none focus:ring-2 focus:ring-white focus:ring-offset-2 focus:ring-offset-indigo-600 sm:px-10"
                    >
                      <RichText
                        value={attributes.contentUD}
                        default={"Notify me"}
                        onChange={(newtext) =>
                          setAttributes({ contentUD: newtext })
                        }
                      />
                    </button>
                  </div>
                </form>
              </div>
            </div>
          </div>
        </div>
      </div>
    );
  },
  save: function (props) {
    const { attributes } = props;
    const arData = repeaterData(props.attributes.hidden, true);

    return (
      <div class="bg-white py-16 sm:py-24">
        
        <div class="relative sm:py-16">
          
          <div aria-hidden="true" class="hidden sm:block">
            
            <div class="absolute inset-y-0 left-0 w-1/2 bg-gray-50 rounded-r-3xl">
             <RichText.Content value={attributes.contentUA}/>
            </div>
            <svg
              class="absolute top-8 left-1/2 -ml-3"
              width="404"
              height="392"
              fill="none"
              viewBox="0 0 404 392"
            >
              
              <defs>
                
                <pattern
                  id="8228f071-bcee-4ec8-905a-2a059a2cc4fb"
                  x="0"
                  y="0"
                  width="20"
                  height="20"
                  patternUnits="userSpaceOnUse"
                >
                  
                  <rect
                    x="0"
                    y="0"
                    width="4"
                    height="4"
                    class="text-gray-200"
                    fill="currentColor"
                  />
                </pattern>
              </defs>
              <rect
                width="404"
                height="392"
                fill="url(#8228f071-bcee-4ec8-905a-2a059a2cc4fb)"
              />
            </svg>
          </div>
          <div class="mx-auto max-w-md px-4 sm:max-w-3xl sm:px-6 lg:max-w-7xl lg:px-8">
            
            <div class="relative rounded-2xl px-6 py-10 bg-indigo-600 overflow-hidden shadow-xl sm:px-12 sm:py-20">
              
              <div
                aria-hidden="true"
                class="absolute inset-0 -mt-72 sm:-mt-32 md:mt-0"
              >
                
                <svg
                  class="absolute inset-0 h-full w-full"
                  preserveAspectRatio="xMidYMid slice"
                  xmlns="http://www.w3.org/2000/svg"
                  fill="none"
                  viewBox="0 0 1463 360"
                >
                  
                  <path
                    class="text-indigo-500 text-opacity-40"
                    fill="currentColor"
                    d="M-82.673 72l1761.849 472.086-134.327 501.315-1761.85-472.086z"
                  />
                  <path
                    class="text-indigo-700 text-opacity-40"
                    fill="currentColor"
                    d="M-217.088 544.086L1544.761 72l134.327 501.316-1761.849 472.086z"
                  />
                </svg>
              </div>
              <div class="relative">
                
                <div class="sm:text-center">
                  
                  <h2 class="text-3xl font-extrabold text-white tracking-tight sm:text-4xl">
                   <RichText.Content value={attributes.contentt}/>
                  </h2>
                  <p class="mt-6 mx-auto max-w-2xl text-lg text-indigo-200">
                   <RichText.Content value={attributes.contentUB}/>
                  </p>
                </div>
                <form 
                  action={attributes.action}
                  method={attributes.method}
                  class="mt-12 sm:mx-auto sm:max-w-lg sm:flex">
                  
                  {arData.map((v) => {
                    return <input type="hidden" name={v.name} value={v.val} />;
                  })}
                  <div class="min-w-0 flex-1">
                    
                    <label for="cta-email" class="sr-only">
                     <RichText.Content value={attributes.contentUC}/>
                    </label>
                    <input
                      id="cta-email"
                      type="email"
                      class="block w-full border border-transparent rounded-md px-5 py-3 text-base text-gray-900 placeholder-gray-500 shadow-sm focus:outline-none focus:border-transparent focus:ring-2 focus:ring-white focus:ring-offset-2 focus:ring-offset-indigo-600"
                      placeholder="Enter your email"
                    />
                  </div>
                  <div class="mt-4 sm:mt-0 sm:ml-3">
                    
                    <button
                      type="submit"
                      onclick={`sendEmail('${name}'); return false;`}
                      class="block w-full rounded-md border border-transparent px-5 py-3 bg-indigo-500 text-base font-medium text-white shadow hover:bg-indigo-400 focus:outline-none focus:ring-2 focus:ring-white focus:ring-offset-2 focus:ring-offset-indigo-600 sm:px-10"
                    >
                     <RichText.Content value={attributes.contentUD}/>
                    </button>
                  </div>
                </form>
              </div>
            </div>
          </div>
        </div>
      </div>
    );
  },
});
